import React from 'react';

function Login() {
  return (
    <div id="login-container">
      <object id="login-logo" type="image/svg+xml" data="logo.svg" aria-label="logo"></object>
      <div id="login-box">
        <input id="login-input-id" value="아이디">

        </input>
        <input id="login-input-password">

        </input>
        <button id="login-btn">
          로그인
        </button>
        <a id="login-signin" href="">
          아직 아이디가 없으신가요?
        </a>
      </div>
    </div>
  );
}

export default Login;
